			INSERT INTO ARTICLE (Title, Content, Employee, [Date], [Image], Tag, Status) VALUES
    ('Natural vs. Lab Diamonds', 'Natural and lab-grown diamonds are identical to the naked eye. In fact, most experts can''t even tell them apart without specialized equipment. Ultimately, the main difference is how they''re created. Learn more to understand which diamond type suits your style.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F369828bf6d7c48d6ae52eb7edb069602', 'Blog', 1),
    ('Colored Diamonds', 'Explore our curated collection of natural and lab created colored diamonds in a variety of stunning shades.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F67a2c143703b4239a605d7b3a10d4420', 'Product Description Section', 1),
    ('The Capture Collection', 'We capture CO₂ before it is released into the atmosphere to create the most innovative lab grown diamonds on the planet.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'News', 1),
    ('Design Your Own Earrings', 'Select your setting and diamonds to get exactly what you''re looking for.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'Services', 1),
    ('Design Your Own Necklace', 'Customize a solitaire necklace with a setting and gemstone that suit your style.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F3f926b3050bd4f6baa39fe0b3db32fd3', 'Services', 1),
    ('OUR BEGINNING', 'In 2019, after witnessing the gap in ethical and sustainable options within the diamond industry, visionary entrepreneur Danielle Taylor embarked on a mission to redefine the narrative. Inspired by Beth Gerstein''s journey, Danielle envisioned a diamond jewelry brand that not only symbolized love but also upheld principles of environmental stewardship and ethical sourcing. With a shared commitment to sustainability, Danielle partnered with renowned jeweler Michael Adams to establish DIAN Diamond Jewelry in 2022. Together, they pioneered innovative approaches to diamond sourcing and transparency, leveraging cutting-edge technology to trace each gemstone''s origin. By offering consumers the assurance of ethical practices and environmental responsibility, DIAN quickly gained recognition as a leader in sustainable luxury jewelry, inspiring a new generation of conscientious consumers to adorn themselves with diamonds that shine with integrity and purpose.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'About', 1),
    ('The Journey of a Diamond', 'Follow the remarkable journey of a diamond from its formation deep within the Earth to its transformation into a dazzling piece of jewelry. This educational piece sheds light on the natural processes and human efforts involved in bringing these precious gems to market.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F3f926b3050bd4f6baa39fe0b3db32fd3', 'Education', 1),
    ('Sustainable Diamond Mining', 'Discover the sustainable practices that are transforming the diamond mining industry. From minimizing environmental impact to ensuring fair labor practices, learn how the industry is working towards a more ethical future.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'Blog', 1),
    ('Choosing the Perfect Diamond', 'A comprehensive guide to selecting the perfect diamond. Understand the 4Cs – cut, color, clarity, and carat – and how they affect a diamond’s appearance and value.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F67a2c143703b4239a605d7b3a10d4420', 'Education', 1),
    ('Ethical Diamond Sourcing', 'Learn about the importance of ethical diamond sourcing and how it impacts both the environment and the communities involved. Our commitment to transparency and sustainability ensures that every diamond you purchase has a positive impact.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F3f926b3050bd4f6baa39fe0b3db32fd3', 'News', 1),
    ('The Future of Lab-Grown Diamonds', 'As technology advances, lab-grown diamonds are becoming more popular. Explore the benefits of these diamonds and how they compare to natural diamonds in terms of quality, price, and environmental impact.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'Education', 1),
    ('Diamond Jewelry Trends', 'Stay up-to-date with the latest trends in diamond jewelry. From classic designs to modern innovations, find inspiration for your next piece of jewelry.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F369828bf6d7c48d6ae52eb7edb069602', 'Blog', 1),
    ('Our Commitment to Ethical Practices', 'At our company, we are committed to ethical practices in every aspect of our business. Learn more about our efforts to ensure that our diamonds are sourced responsibly and our employees are treated fairly.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'About', 1),
    ('Diamond Care and Maintenance', 'To keep your diamond jewelry looking its best, proper care and maintenance are essential. Follow our expert tips to ensure your diamonds remain brilliant and beautiful for years to come.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'Service', 1),
    ('The Science Behind Diamonds', 'Explore the fascinating science behind the formation of diamonds. From their creation deep within the Earth to their unique properties, discover what makes diamonds so special.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F369828bf6d7c48d6ae52eb7edb069602', 'Education', 1),
    ('Customer Testimonials', 'Hear from our satisfied customers about their experiences with our diamond jewelry. Their stories highlight the quality and craftsmanship of our products and the exceptional service we provide.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'Service', 1),
    ('Advancements in Diamond Cutting Technology', 'Recent advancements in diamond cutting technology have significantly enhanced the precision and brilliance of diamond jewelry. Learn about the latest techniques and their impact on the diamond industry.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'Blog', 1),
    ('Eco-Friendly Jewelry Packaging', 'Our commitment to sustainability extends beyond our diamonds to our packaging. Discover how we use eco-friendly materials and innovative designs to reduce our environmental footprint.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F3f926b3050bd4f6baa39fe0b3db32fd3', 'News', 1),
    ('Understanding Diamond Certification', 'Diamond certification provides an objective assessment of a diamond''s quality. Learn about the different types of certifications and what they mean for your diamond purchase.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'Education', 1),
    ('The Impact of Diamond Mining on Local Communities', 'Diamond mining can have significant impacts on local communities. Explore the social and economic effects and how companies can support positive outcomes.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'Blog', 1),
    ('Innovative Uses for Diamonds Beyond Jewelry', 'Diamonds are not just for jewelry. Discover the innovative uses for diamonds in technology, industry, and science.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F67a2c143703b4239a605d7b3a10d4420', 'Education', 1),
    ('Spotlight on Diamond Artisans', 'Meet the skilled artisans behind our exquisite diamond jewelry. Learn about their craftsmanship, dedication, and the intricate processes they use to create each piece.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F369828bf6d7c48d6ae52eb7edb069602', 'About', 1),
    ('The Economic Impact of the Diamond Industry', 'The diamond industry plays a significant role in the global economy. Understand its economic impact, from mining to retail, and its contributions to job creation and economic development.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Ff4562a479cb049a2b8e5f1787d3f4633', 'News', 1),
    ('Custom Engagement Rings', 'Design your own engagement ring with our bespoke service. Choose from a range of settings and diamonds to create a unique symbol of your love.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2Fa9aa8fd2de794d0581588e4a187d878e', 'Services', 1),
    ('The History of Diamonds', 'Explore the rich history of diamonds, from ancient times to the modern era. Learn about their cultural significance and how they became the ultimate symbol of love and luxury.', 3, GETDATE(), 'https://image.brilliantearth.com/cdn-cgi/image/width=720,height=545,quality=100,format=auto/https://cdn.builder.io/api/v1/image/assets%2F9f2a69003c86470ea05deb9ecb9887be%2F369828bf6d7c48d6ae52eb7edb069602', 'Education', 1);
